import React from 'react';
import { ImageBackground,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert } from 'react-native';
import { JSHash, CONSTANTS } from "react-native-hash";

export default function App() {

    hash.hashString("123", CONSTANTS.HashAlgorithms.sha256)
    .then(hash => console.log(hash))
    

  return (
    <View style={styles.container}>
      <ImageBackground style={styles.image} source={{uri:'https://images8.alphacoders.com/377/thumb-1920-377774.png'}} >
      <View style = {styles.content}>
        <TextInput style={styles.input}
        autoCapitalize='none'
        autoCorrect={false}
        clearTextOnFocus={false}
        keyboardAppearance='dark'
        keyboardType='number-pad'
        maxLength={8}
        placeholderTextColor='white'
        placeholder='Password'
        selectTextOnFocus={true}
        textAlign='center'
      >
        </TextInput>
        <TouchableOpacity style={styles.button}>
          <Text style={{fontSize:22,color:'white'}}>Sign</Text>
        </TouchableOpacity>
      </View>
     </ImageBackground>
     
    </View>
  );
}

const styles = StyleSheet.create({
 
  image:{
   backgroundColor:"#8A2FE5",
    alignItems:'center',
    justifyContent:'center',
    width:'100%',
    height:'100%'
  },
  input:{
    alignItems:"center",
    justifyContent:'center',
    backgroundColor: 'rgba(138, 200, 229, 0.2)',
    height:'7%',
    width:'100%',
    borderRadius:30,
    fontSize:22,
    color:'white'
    
  },
  container: {
    flex: 1,
    marginTop:30,
    alignItems: 'center',
    justifyContent: 'center',
  },
  content:{
    flex:1,
    height:'70%',
    width:'80%',
    alignItems:'center',
    justifyContent:'center'
  },
  button:
  {
    backgroundColor: 'rgba(138, 200, 229, 0.2)',
    marginTop:40,
    height:'7%',
    width:'100%',
    alignItems:'center',
    borderRadius:60,
    justifyContent:'center',
    
  }
});
